import './styles/playerslist.css';

const PlayersList = ({players}) => {
    return (
        <div class="main2">
            <div class="players">Gracze:</div>

            {players.map((p) => (
                <h3 key={p.id}>{p.name}</h3>
            ))}
        </div>
    )
}

export default PlayersList
